import styled from "styled-components";

const UploadButtonStyled = styled.button`
  display: flex;
  align-items: center;
  align-contents: center;
  justify-content: center;
  border: 1px solid black;
  border-radius: 50px;
  width: 80px;
  height: 80px;
  padding: 0;
  margin: 0;
`;

export default UploadButtonStyled;
